import React from 'react'
import {Button} from "reactstrap";

class UpButton extends React.Component {
  render(){
    return(
      <>
      <Button
        className="p-0 up-btn-circle m-0 mr-3 mt-1"
        color="default"
      >
        <i className="fa fa-arrow-up" />
      </Button>
      </>
    );
  }
}
export default UpButton;
